import { useCookies } from "react-cookie";
import './App.css';
import LoginPage from "./LoginPage.js";

function App() {
  const [cookies, setCookie] = useCookies(["user"]);
  function handleLogin(user) {
    setCookie("user", user, { path: "/" });
  }
  return (
    <div className="App">

      <header />

      <LoginPage onLogin={handleLogin} />

      <footer />

    </div>
  );
}

export default App;
